import React from 'react';

interface CardProps {
    id: string;
    title: string;
    description: string;
    onDragStart: (e: React.DragEvent<HTMLDivElement>, id: string) => void;
}

const Card: React.FC<CardProps> = ({ id, title, description, onDragStart }) => {
    return (
        <div
            draggable
            onDragStart={(e) => onDragStart(e, id)}
            className="card"
        >
            <h4>{title}</h4>
            <p>{description}</p>
        </div>
    );
};

export default Card;
